import React from "react";
import {Text,View,TextInput,StyleSheet} from "react-native";

export default function Calculate ()
{
    return(
        <View style = {styles.poles}> 
            {/* 5 окошек */}
            <TextInput placeholder = 'Q'/> 
            <TextInput placeholder = 'c'/> 
            <TextInput placeholder = 'm'/> 
            <TextInput placeholder = 'T1'/> 
            <TextInput placeholder = 'T2'/> 
        </View>
    )  
};
 const styles = StyleSheet.create(
     {
        poles:
        {
            color:'black',
            flexDirection: 'row',
            width: 50,
        }
     }
 )
